          </div>
          <div align="center" className="sectionBack">
            <NavLink to="/">BACK</NavLink>
          </div>
        </div>
        <div className="content">
          <img src={imgRight} className="imgHome" alt="imgOrganizationalDesign"/>
        </div>
      </div>
    );
  }
}

export default OrganizationalDesing;
